import React from 'react';

const Todolist = (props) => {
   
    return(
        <>
            <div>
            <li>{props.text}</li>
                <button className="minus" onClick={ () => {
                    props.onSelect(props.id) 
                    } 
                    }>-</button>
                
            </div>
        </>
    );
};

export default Todolist;
